  false,\n\t\"url\": null,\n\t\"notes\": \"These ESRI shape files are of National
  Park Service tract and boundary data that was created by the Bureau of Land Maganement
  in GCDB for the Midwest Regional Office. Tracts are numbered and created by the
  regional cartographic staff at the Land Resources Program Centers and are associated
  to the Land Status Maps. This data should be used to display properties that NPS
  owns and properties that NPS may have some type of interest such as scenic easements
  or right of ways.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
